import { useLocation } from "react-router-dom";

import RecordingVideo from "../components/RecordingVideo";

export default function Game(){
    const location = useLocation();

    const { team, players } = location.state || []; // Ensure safe destructuring

    const teamName = team.properties?.Name.title[0].plain_text;

    return(
        <div className = "page">
            <h1>{ teamName }</h1>
            <p>Start Recording Game for { teamName }</p>

            {/* <VideoRecorder/> */}

            <RecordingVideo/>

            <h2>Playing</h2>

            <hr/>

            <h2>Players ({ players.length })</h2>
            <p className = "meta">Press the player button to timestamp highlight</p>
            {/* SIGN UP */}
            { players.map( ( item, index ) => (
                <div key = { index }>
                    <img className = "profile" src = "https://www.tottenhamhotspur.com/media/5y3crbxe/firstteam_profiles_mickyvandeven_202425_1.png?anchor=center&mode=crop&quality=90&width=500"/>
                    <p className = "number">{ item.properties.back_number.rich_text[0].plain_text }</p>
                    <p>{ item.properties?.Name.title[0].plain_text }</p>
                    <p>{ item.properties.first_name.rich_text[0].plain_text } { item.properties.last_name.rich_text[0].plain_text }</p>
                </div>
            ))}


        </div>
    )
}
